import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../InstituteDashboard.css';
import logo from '../images/GCC-TBC.png';
import Dashboard from './Dashboard';
import StudentForm from './StudentForm';
import StudentList from './StudentList';
import PayStudentList from './PayStudentList';
import { Routes, Route, Outlet } from 'react-router-dom';

const InstituteDashboard = () => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  const closeSidebar = () => {
    if (isSidebarOpen) {
      setIsSidebarOpen(false);
    }
  };

  return (
    <div>
      <nav className="navbar">
        <div className="logo">
          <img src={logo} alt="logo" />
          <div className="text-normal" style={{ whiteSpace: 'nowrap', fontSize: '0.9rem', display: 'block', alignItems: 'center', fontWeight: 'bold' }}>
            <span>MSCE PUNE COMPUTER SHORTHAND DEMO</span>
            <div className="institute-info">
              15001 ABC Computer Typing Institute
            </div>
          </div>
        </div>
        <ul className={`menu-links ${isSidebarOpen ? 'open' : ''}`}>
          <li className="nav-link" onClick={closeSidebar}>
            <Link to="/"> {/* Directs to Dashboard component */}
              <span>Dashboard</span>
            </Link>
          </li>
          <li className="nav-link" onClick={closeSidebar}>
            <Link to="registration"> {/* Directs to the StudentForm component */}
              <span>Registration Form</span>
            </Link>
          </li>
          <li className="nav-link" onClick={closeSidebar}>
            <Link to="students"> {/* Directs to the StudentList component */}
              <span>Students List</span>
            </Link>
          </li>
          <li className="nav-link" onClick={closeSidebar}>
            <Link to="paystudents"> {/* Directs to the PayStudentList component */}
              <span>Pay Fees</span>
            </Link>
          </li>
        </ul>
        <div className="nav-link">
          <div className="menu-container">
            <Link to="/login_institute" className="logout-link" onClick={closeSidebar}>
              <span>Log Out</span>
            </Link>
            <button className="menu-toggle" onClick={toggleSidebar}>☰</button>
          </div>
        </div>
      </nav>

      <div className="main-content">
        <Outlet />
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="registration" element={<StudentForm />} />
          <Route path="students" element={<StudentList />} />
          <Route path="paystudents" element={<PayStudentList />} />
        </Routes>
      </div>
    </div>
  );
};

export default InstituteDashboard;
